'                    </h2>',
'                    <div class="slide-content">',
'                        <p class="t-Body-text" style="-webkit-text-stroke-width:0px;color:rgb(0, 0, 0);font-family:&quot;Times New Roman&quot;;font-size:medium;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;l'
||'etter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;">',
unistr('                            A descentraliza\00E7\00E3o traz benef\00EDcios estrat\00E9gicos como:'),
'                        </p>',
'                        <ul class="t-BulletList" style="-webkit-text-stroke-width:0px;color:rgb(0, 0, 0);font-family:&quot;Times New Roman&quot;;font-size:medium;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400'
||';letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;">',
'                            <li>',
unistr('                                <strong class="animate__animated animate__heartBeat animate__repeat-7 animate__slower">Agilidade:</strong> redu\00E7\00E3o do tempo de entrega das solu\00E7\00F5es.'),
'                            </li>',
'                            <li>',
unistr('                                <strong class="animate__animated animate__heartBeat animate__repeat-7 animate__slower">Proximidade com o neg\00F3cio:</strong> maior alinhamento entre as \00E1reas final\00EDsticas e as solu\00E7\00F5es desenvolvidas.'),
'                            </li>',
'                            <li>',
unistr('                                <strong class="animate__animated animate__heartBeat animate__repeat-7 animate__slower">Escalabilidade:</strong> aumento da capacidade de atendimento da STI sem comprometer a governan\00E7a.'),
'                            </li>',
'                            <li>',
unistr('                                <strong class="animate__animated animate__heartBeat animate__repeat-7 animate__slower">Padroniza\00E7\00E3o:</strong> manuten\00E7\00E3o da identidade institucional e das boas pr\00E1ticas de desenvolvimento.'),
'                            </li>',
'                        </ul>',
'                        <p>',
'                            <span style="color:rgb(0,0,0);"><span style="-webkit-text-stroke-width:0px;display:inline !important;float:none;font-family:&quot;Times New Roman&quot;;font-size:medium;font-style:normal;font-variant-caps:normal;font-varia'
||'nt-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-sp'
||unistr('acing:0px;">Dessa forma, a Governan\00E7a do Desenvolvimento Descentralizado no MJSP garante o equil\00EDbrio entre autonomia e controle t\00E9cnico, promovendo efici\00EAncia, qualidade e conformidade com os padr\00F5es de tecnologia e seguran\00E7a da informa\00E7\00E3o do Minist')
||unistr('\00E9rio.</span></span>'),
'                        </p>',
'                    </div>',
'                </div>',
'                <div class="slide" id="slide-ciclo">',
'                    <h2 class="slide-title">',
'                        Ciclo de vida do software',
'                    </h2>',
'                    <div class="slide-content">',
'                        <p class="hidden-sm-down">',
unistr('                            A metodologia de desenvolvimento tradicional, embora baseada em um modelo \00E1gil, em raz\00E3o de v\00E1rios fatores (limita\00E7\00E3o de equipe ou recursos, altera\00E7\00F5es de planejamentos, etc) \00E9 um processo que, via de regra, demora para en')
||'tregar o produto final.',
'                        </p>',
'                        <p>',
unistr('                            No processo de desenvolvimento descentralizado, os pap\00E9is de <i>Product Owner</i>(gestor), <i>Product Manager</i>(gerente), <i>Scrum Master</i>(l\00EDder do time) e time de desenvolvimento recaem sobre pessoas muito pr\00F3ximas, ')
||'ou sobre a mesma pessoa, facilitando o processo de desenvolvimento.',
'                        </p>',
'                        <ul class="t-BulletList">',
'                            <li>',
unistr('                                <strong>Empoderamento do usu\00E1rio:</strong> a equipe de desenvolvimento \00E9 muitas vezes o usu\00E1rio final da aplica\00E7\00E3o, tendo poder de decis\00E3o sobre cada etapa do desenvolvimento (decide sobre o backlog e sprints).'),
'                            </li>',
'                            <li>',
unistr('                                <strong>Transfer\00EAncia de responsabilidades:</strong> a equipe de desenvolvimento \00E9 tamb\00E9m respons\00E1vel pelo sistema (decide quando ser\00E1 lan\00E7ado, e quando ser\00E1 descontinuado).'),
'                            </li>',
'                            <li>',
unistr('                                <strong>Compartilhamento da solu\00E7\00E3o:</strong> a DSD atua como suporte e "fiscal t\00E9cnico" dos projetos.'),
'                            </li>',
'                        </ul>',
'                    </div>',
'                </div>',
'                <div class="slide  hidden-sm-down" id="slide-ciclo2">',
'                    <h2 class="slide-title">',
'                        Ciclo de vida do software',
'                    </h2>',
'                    <div class="slide-content">',
'                        <img src="#APP_FILES#img/Fluxograma.png" height="80%">',
'                    </div>',
'                </div>                ',
'                <div class="slide" id="slide-desafios">',
'                    <h2 class="slide-title animate__animated animate__heartBeat animate__repeat-7 animate__slower">',
'                        Diretrizes do Desenvolvimento Descentralizado',
'                    </h2>',
'                    <div class="slide-content">',
unistr('                        <p>Considerando a import\00E2ncia de se estabelecer as boas pr\00E1ticas no uso da plataforma APEX para desenvolvimento de aplica\00E7\00F5es, cada aplicativo desenvolvido, independente de se tratar de solu\00E7\00E3o setorial ou corporativa, deve, d')
||'entre as demais medidas repassadas pela unidade coordenadora:</p>',
'                        <ul style="list-style-type: disc;margin-left: 82.7px;">',
unistr('                            <li>Seguir os fundamentos de <strong>identidade visual</strong><span class="hidden-sm-down"> adotados pelo Governo Federal e MJSP, sendo este um fator respons\00E1vel por criar <strong>consist\00EAncia</strong> e por garantir a <s')
||unistr('trong>coes\00E3o</strong> nas comunica\00E7\00F5es digitais ou f\00EDsicas, trazendo <strong>reconhecimento e credibilidade</strong> para o servi\00E7o oferecido, por meio do uso de cores, tipografia, e outros elementos gr\00E1ficos. Tal medida visa trazer melhor usabilidad')
||unistr('e aos usu\00E1rios que possuem experi\00EAncia com os demais servi\00E7os digitais do \00F3rg\00E3o.</span></li>'),
unistr('                            <li>Seguir o <strong>padr\00E3o de autentica\00E7\00E3o</strong><span class="hidden-sm-down"> de usu\00E1rios definidos pela STI, bem como possuir, se for o caso, regras de permiss\00E3o e perfil de acesso definidos, observando os demais padr')
||unistr('\00F5es de seguran\00E7a estabelecidos pela STI.</span></li>'),
unistr('                            <li>Seguir os <strong>padr\00F5es de nomenclatura</strong> <strong>de objetos de Modelo de Dados</strong> <strong>Relacional</strong><span class="hidden-sm-down">, para garantir a compreens\00E3o, a consist\00EAncia e a manuten\00E7\00E3o ade')
||unistr('quada do modelo de dados ao longo do tempo e entre os diferentes sistemas e departamentos, al\00E9m de gerar melhor <strong>qualidade dos dados</strong> por meio do uso de regras de valida\00E7\00E3o, n\00E3o replicar desnecessariamente dados j\00E1 existentes no banco ')
||'de dados do MJSP.</span></li>',
unistr('                            <li>Seguir os <strong>padr\00F5es de armazenamento de arquivos</strong> em servidor de arquivos especificado pela STI.</li>'),
'                        </ul>',
'',
'                    </div>',
'                </div>',
'                <div class="slide" id="slide-desafios-2">',
'                    <h2 class="slide-title">',
'                        Diretrizes do Desenvolvimento Descentralizado',
'                    </h2>',
'                    <div class="slide-content">',
'                        <ul style="list-style-type: disc;margin-left: 82.7px;">',
unistr('                            <li>Seguir os padr\00F5es de seguran\00E7a exigidos quanto ao uso de API''s internas. <strong><span class="hidden-sm-down">\00E9 vedada a cria\00E7\00E3o de APIs no workspace do projeto sem autentica\00E7\00E3o.</span></strong><span class="hidden-sm-d')
||unistr('own"> Ou seja, toda API criada deve ter autentica\00E7\00E3o b\00E1sica (usu\00E1rio e senha) ou por meio de tokens de acesso. A documenta\00E7\00E3o da API deve ser informada na documenta\00E7\00E3o m\00EDnima (documento de vis\00E3o geral) do projeto. </span></li>'),
unistr('                            <li>At\00E9 a determina\00E7\00E3o, pela unidade coordenadora, sobre as diretrizes para uso de intelig\00EAncia artificial nos sistemas do MJSP, <strong>\00E9 vedado o uso das funcionalidades de intelig\00EAncia artificial</strong> nos projetos d')
||'esenvolvidos em Low Code. </li>',
unistr('                            <li>At\00E9 a determina\00E7\00E3o, pela unidade coordenadora, sobre as diretrizes para uso de plugins nos sistemas do MJSP, <strong>\00E9 vedado o uso de plugins externos (de terceiros al\00E9m da Oracle)</strong> nos projetos em desenvolvim')
||'ento com Low Code Apex. </li>',
'                        </ul>',
unistr('                        <p class="hidden-sm-down"><strong>Todo aplicativo LC deve ser desenvolvimento no ambiente n\00E3o produtivo, e, ap\00F3s an\00E1lise pela unidade de coordena\00E7\00E3o e governan\00E7a, migrado para uso no ambiente de produ\00E7\00E3o</strong>.</p>'),
unistr('                        <p>Acesse <strong><a href="https://acelera.mj.gov.br" target="_blank">acelera.mj.gov.br</a></strong> para atualizar as informa\00E7\00F5es de seu projeto, solicitar suporte ou saber mais sobre as diretrizes do desenvolvimento descentr')
||'alizado.</p>',
'',
